import React, { Component } from 'react';
import { signOut } from "firebase/auth";
import { auth } from '../../firebase_config'
import { Link, useNavigate } from "react-router-dom";

function Navbar(props) {
    const navigate = useNavigate();
    const signingOut = (e) => {
        e.preventDefault();
        signOut(auth).then(() => {
            // Sign-out successful.
            props.userchange(auth.currentUser);
            console.log('bye')
            console.log(auth.currentUser)
            navigate("/")
        }).catch((error) => {
            // An error happened.
            console.log(error);
        });
    }
    return (
        <nav id="navTop" class="navbar navbar-expand-lg navbar-light bg-light mx-lg-5 mx-2 py-3 fixed-top">
        <div class="container-fluid d-flex flex-nowrap">
        <a class="navbar-brand me-1" href="#">LOGO</a>
        <div class="d-flex w-100 align-items-center" id="">
            <div class="w-100 mx-lg-5 mx-1"> 
                    <div class="rounded-pill bg-white w-100 d-flex align-items-center ps-2">	
                        <i class="fas fa-search"></i>
                        <input class="form-control border-0 w-100 bg-transparent" type="search" placeholder="Recherche" aria-label="Search"/>
                    </div>
            </div>
            <div class="d-flex mx-lg-2 align-items-center">
                    <i class="far fa-comments fa-2x mx-1 d-lg-none"></i>
            <button class="btn btn-dark h-auto py-1 d-none d-lg-block" type="submit">Plannifier un voyage</button>
        <button class="btn btn-outline-light  p-3 rounded-circle ms-2" type="button" id="dropdownMenuButton1" data-bs-toggle="dropdown" aria-expanded="false" style="background:url('https://images.unsplash.com/photo-1543610892-0b1f7e6d8ac1?crop=entropy&cs=srgb&fm=jpg&ixid=MnwxNDU4OXwwfDF8cmFuZG9tfHx8fHx8fHx8MTYzNzg0MzgwNw&ixlib=rb-1.2.1&q=85');background-size:cover; height:60px; width:60px;" data-bs-toggle="tooltip" data-bs-placement="bottom" title="Tooltip on bottom">
                    </button>
                    <ul class="dropdown-menu end-0" aria-labelledby="dropdownMenuButton1">
                        <li class="d-flex flex-column justify-content-center align-items-center">
                            <div class="rounded-circle" style="height:50px;width:50px;background:url('https://images.unsplash.com/photo-1543610892-0b1f7e6d8ac1?crop=entropy&cs=srgb&fm=jpg&ixid=MnwxNDU4OXwwfDF8cmFuZG9tfHx8fHx8fHx8MTYzNzg0MzgwNw&ixlib=rb-1.2.1&q=85');background-size:cover;"></div>	
                            <p class="text-center text-capitalize mt-2 mb-0">Nasser nourou</p>
                            <small class="">Lorem ipsum dolor sit amet consectetur.</small>
                        </li>
                        <li>
                            <a class="dropdown-item" href="#">Another action</a>
                        </li>
                        <li><a class="dropdown-item" href="#">Something else here</a></li>
                    </ul>
            </div>
        </div>
        </div>
        </nav>
          
    );
}

export default Navbar;
